export default function FloatInput(props) {
  return (
    <FormControl size="small">
      <InputLabel>{props.label}</InputLabel>
      <OutlinedInput
        value={props.val}
        type="number"
        onChange={(ev) => handleChange(parseFloat(ev.target.value).toFixed(2))}
        label={props.label}
      />
    </FormControl>
  );
}
